import React, { useState } from "react";
import Home from "./components/Home";
import Stacks from "./components/Stacks";
import Projects from "./components/Projects";
import { ImHome, ImStack } from "react-icons/im";
import { MdWork } from "react-icons/md";

import "./App.css";
function App() {
  const [screen, setScreen] = useState(Home);
  return (
    <>
      <div className="icons">
        <button
          className="icon"
          title="tooltip"
          onClick={() => setScreen(Home)}
        >
          <ImHome size="35" />
        </button>
        <button className="icon" onClick={() => setScreen(Stacks)}>
          <ImStack size="35" />
        </button>
        <button className="icon" onClick={() => setScreen(Projects)}>
          <MdWork size="35" />
        </button>
      </div>
      <div>
        <h1>{screen}</h1>
      </div>
    </>
  );
}

export default App;
